INSERT INTO `catalog_product_entity_text` VALUES (1,4,57,0,1,'<p>This is a brand new good. It is really a <em>bestseller</em>, many facts prove, that no other commodity has such a high rating. You have to try on this good because you can compare it with other alternative products and make your own conclusion, which will prove that we were right about it, and this commodity really worth it. We all know this good very well and many people may say that there is nothing that could amaze them, but believe me it’s the one.  It has <em>millions of fans</em> all over the world, and those people are really satisfied, they even could not imagine that our good would be so adorable. So, there is nothing better than thanks from pleased, joyful clients.</p> \r\n<p>First reason is the unique internals, and as you know there are two main points in any good. These are the quality and the price. Guess what? Yes, this product is the unbeaten combination of fair price and superb quality. What could be better? It\'s only our product. We’re sure that no one could stay indifferent because everybody wants to get professionally made up product and pay for that medium price. Our manufacturers and vendors guarantee its high quality. \r\nOur product is universal because it suits different customers with different demands. And we assure you it is really important, it shows that our good has such capacity as flexibility. And it is good for you, because as we all know people change their claims with the course of time, and our good will be actual for a long time. </p>'),(2,4,58,0,1,'<p>This is a<strong> brand new</strong> good. It is really a bestseller, many facts prove, that no other commodity has such a high rating. You have to try on this good because you can compare it with other alternative products and make your own conclusion, which will prove that we were right about it, and this commodity really worth it.</p> \r\n<p>We all know this good very well and many people may say that there is nothing that could amaze them, but believe me it’s the one.</p>  '),(3,4,68,0,1,''),(4,4,89,0,1,''),(9,4,57,0,3,'<p>Also this commodity has very <strong>high measure of reliability</strong>, and this is one of the main advantages of it. Nowadays we have faced the wave of numerous fakes and falsifications. And sometimes even respectable companies suffer from falsification. And this process has some negative results for everyone. But the main victim of this process is you – simple consumer. So, you must be aware of fakes. Sometimes we are not attentive, and because of that our company sells only quality goods. We are providing policy of brand commodities.</p> \r\n<p>This good is totally safe for your health. It has passed many various tests without a single failure. This product has unique design and many special options, which could indeed help you. You know, nowadays good design is a really important thing. Fashion in this case is really interesting <em>phenomenon</em> - we often like things that are nice evidently. And it is normal - after all we get maximum information with the help of the eyes. And our product is a perfect combination of cute shapes and real good content. <strong>It is really a product of a new generation</strong>. We promise that with our good you will always be in fashion and stylish. For those people who don’t care about fashion, we offer some interesting design versions, which have simple design and functional options.</p>  \r\n<p>Our products are very simple in use, so even an unskilled customer could handle it. The instruction manual for our good is multilingual, and it is also very easy to read. It\'s written on simple language and everything is strict and logical. Also our 24/7 support system will help you solve your problems anytime. Our delivery and shipping system is always ready to comply with your order. We care about our clients and never let them down.</p> \r\n<p>And don’t forget that we provide our goods for a fair price. You can save some money in our store. Also we are offering our system of exclusive discounts. It’s very easy to get our discount, and after that you get some special facilities.</p> '),(10,4,58,0,3,'<p>First reason is the unique internals, and as you know there are two main points in any good. These are the quality and the price. Guess what? Yes, this product is the unbeaten combination of fair price and superb quality. What could be better? It\'s only our product. \r\nWe’re sure that no one could stay indifferent because everybody wants to get professionally made up product and pay for that medium price.</p> '),(11,4,68,0,3,''),(12,4,89,0,3,''),(13,4,57,0,4,'<p>It will suit you best of all. Because we all live in the time of total consuming of uncountable <em>goods and services</em>, and this has become the main reason for the rapid growth of a so-called culture of consumption in our society. So, this circumstance forced all leading successful companies to explore all needs and wishes of different groups of potential clients very deeply. And that is why we are offering you the result of great market and technological research – our magnificent product. Our employees put in great efforts to make this commodity. Our good was made up by best experts with the help of <strong>most advanced technologies</strong>, and it gives us right to consider this product to be a premium one.</p> \r\n<p>You know, nowadays we have also faced the problem of choice. All these new technologies that surround us, they became so much more available and many stores use them to represent us numerous goods, and often we are not even sure if it’s necessary to purchase it. But this problem is not about this case, because even if you haven’t decided that you need this product, we will gladly help you and together we will find out you needs. After that we will offer you exactly what you need.</p>'),(14,4,58,0,4,'<p>This good is totally <strong>safe</strong> for your health. It has passed many various tests